# Usaremos las funciones:
def f(t, y):
    return (1 - 2*t)*y

def solucion_exacta(t):
    return np.exp(1/4 - ((1/2) * t)**2)

# Parámetros
t0, y0 = 0, 1  # Condición inicial
t_final = 0.9  # Tiempo final
h_valores = [0.3, 0.15, 0.075]  # Valores de h

